static int sixelWriteCallback(char *data, int size, void *priv) {
	//char clear[] = "\x1b\x5b\x48\x1b\x5b\x32\x4a\x1b\x5b\x33\x4a";
	//fwrite(clear,1,sizeof(clear)-1,stdout);
	fwrite(data,1,size,stdout);
	fflush(stdout);
}


static void blit(out_img_t *dst, gimp_export_t *src, img_offset_t *offset) {
	int src_y = 0;
	int dst_y = offset->y;
	unsigned const char *psrc;
	unsigned char *pdst;
	size_t copylen;
	size_t i;
	
	if( offset->x + src->width >= dst->width ) {
		copylen = (dst->width - offset->x);
	} else {
		copylen = (src->width);
	}
	
	while( src_y < src->height && dst_y < dst->height ) {
		psrc = &(src->pixels[ (src_y*src->width) * 2 ]);
		pdst = &(dst->pixels[ (dst_y*dst->width + offset->x) * 2 ]);
		for( i=0; i<copylen; i++ ) {
			*(pdst+1) = *psrc;
			*(pdst) = *(psrc+1);
			pdst = pdst+2;
			psrc = psrc+2;
		}
		src_y++;
		dst_y++;
	}
}

int sixelDisplay() {
	size_t i;
	img_offset_t zero_off = {0,0};

	imgOutput.width = imgPanel.width;
	imgOutput.height = imgPanel.height;
	blit(&imgOutput,&imgPanel,&zero_off);
	
	if( sixel_dither_new(&dither,256,0) ) {
		printf("Failed to allocate sixel dither\n");
		return 1;
	}
	if( sixel_dither_initialize(dither,(char*)imgOutput.pixels,
				imgOutput.width, imgOutput.height, SIXEL_PIXELFORMAT_RGB565,
				LARGE_AUTO, REP_AUTO, QUALITY_HIGH) ) {
		printf("Failed to initialize sixel dither\n");
		return 1;
	}
	if( sixel_output_new(&output,sixelWriteCallback,0,0) ) {
		printf("Faield to allocate sixel output\n");
		return 1;
	}
	
	for( i=0; i<8; i++ ) {
		if( dv[i] == 0) {
			if( i==2 || i==3 || i == 6 ) {
				blit(&imgOutput,&imgBrkOff,&(doffsets[i]));
			} else {
				blit(&imgOutput,&imgIsoOff,&(doffsets[i]));
			}
		} else if( dv[i] == 1 ) {
			if( i==2 || i==3 || i == 6 ) {
				blit(&imgOutput,&imgBrkOn,&(doffsets[i]));
			} else {
				blit(&imgOutput,&imgIsoOn,&(doffsets[i]));
			}
		}
	}
	
	for( i=0; i<8; i++ ) {
		if( av[i] > 0.0 ) {
			blit(&imgOutput,&imgAnalogOn,&(aoffsets[i]));
		}
	}
	
	if( sixel_encode((char*)imgOutput.pixels,imgOutput.width,imgOutput.height,
		0,dither,output) ) {
		printf("Failed to encode image\n");
	}
	
	sixel_output_destroy(output);
	sixel_dither_destroy(dither);
	
}


